import React, { useEffect, useState } from "react";
import {Table, Button, Col, Container, Form, FormControl, InputGroup, Row } from "react-bootstrap";
import { getNews } from "../../actions/newsAction";


const Dashboard = () => {

    const [newsData, setNewsData] = useState([]);
    
    let result;

    useEffect(()=>{
        result = getNews();
        result.then((res)=>{
            setNewsData(res);
            // console.log(res);
        });

    },[]);

    console.log(newsData)

    

    return (
        <>
            <Table striped hover bordered size="sm">
                <thead>
                    <td>Title</td>
                    <td>Type</td>
                    <td>News</td>
                </thead>
                <tbody>
                    {/* {newsData?.map((val) => {
                        return (
                            <>
                                <tr>
                                    <td>{obj.name}</td>
                                    <td>
                                        
                                    </td>
                                </tr>
                            </>
                        )
                    })} */}
                </tbody>
            </Table>
        </>
    )
}

export default Dashboard;
